function loadTree() {
    $("#myTree")
        .omTree(
            {dataSource: treeData,
                simpleDataModel: true,
                onSelect : function (nodeData) {
                    if (nodeData.furl == "") {
                        if($("#" + nodeData.nid).attr("class").indexOf("collapsable") >= 0){
                            alert("collapsable");
                            if ($("#" + nodeData.nid + ">span").attr("class").indexOf("FirstLayer") >= 0) {
                                $("#" + nodeData.nid + ">span").css("background", "url(/static/css/default/images/tree/Item1_BG.png) no-repeat");
                            } else {$("#" + nodeData.nid + ">span").css("background","url(/static/css/default/images/tree/Item2_BG.jpg) no-repeat");
                            }
                            $('#myTree').omTree('collapse',
                                nodeData);
                        }else if ($("#" + nodeData.nid).attr("class").indexOf("expandable") >= 0){
                            alert("expandable");
                            if ($("#" + nodeData.nid + ">span").attr("class").indexOf("FirstLayer") >= 0) {
                                $("#" + nodeData.nid + ">span").css("background","url(/static/css/default/images/tree/Item1_BG_Select.png) no-repeat");
                            } else {
                                $("#" + nodeData.nid + ">span").css("background","url(/static/css/default/images/tree/Item2_BG_Select.jpg) no-repeat");
                            }
                            $('#myTree').omTree('expand', nodeData);

                        }
                    }else {

                    }
                }

            });

}